{"version":3,"sources":["webpack://metronic/../demo1/src/js/pages/crud/forms/widgets/input-mask.js"],"names":[],"mappings":";;;;;AAAA;;AAEA;;AAEA;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA,SAAS,E;;AAET;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA,SAAS,EAAE;;AAEX;AACA;AACA;AACA,SAAS,E;;AAET;AACA;AACA;AACA,SAAS,EAAE;;AAEX;AACA;AACA;AACA,SAAS,E;;AAET;AACA;AACA,qBAAqB,KAAK,IAAI,KAAK,KAAK,KAAK,KAAK,KAAK,IAAI,KAAK,IAAI,IAAI,KAAK,IAAI;AACjF;AACA;AACA;AACA;AACA,aAAa;AACb;AACA;AACA,yDAAyD,EAAE;AAC3D;AACA;AACA;AACA;AACA,SAAS,E;AACT;;AAEA;AACA;AACA;AACA,oB;AACA;AACA;AACA,CAAC;;AAED;AACA;AACA,CAAC,E","file":"js/pages/crud/forms/widgets/input-mask.js","sourcesContent":["// Class definition\r\n\r\nvar KTInputmask = function () {\r\n    \r\n    // Private functions\r\n    var demos = function () {\r\n        // date format\r\n        $(\"#kt_inputmask_1\").inputmask(\"99/99/9999\", {\r\n            \"placeholder\": \"mm/dd/yyyy\",\r\n            autoUnmask: true\r\n        });\r\n\r\n        // custom placeholder        \r\n        $(\"#kt_inputmask_2\").inputmask(\"99/99/9999\", {\r\n            \"placeholder\": \"mm/dd/yyyy\",\r\n        });\r\n        \r\n        // phone number format\r\n        $(\"#kt_inputmask_3\").inputmask(\"mask\", {\r\n            \"mask\": \"(999) 999-9999\"\r\n        }); \r\n\r\n        // empty placeholder\r\n        $(\"#kt_inputmask_4\").inputmask({\r\n            \"mask\": \"99-9999999\",\r\n            placeholder: \"\" // remove underscores from the input mask\r\n        });\r\n\r\n        // repeating mask\r\n        $(\"#kt_inputmask_5\").inputmask({\r\n            \"mask\": \"9\",\r\n            \"repeat\": 10,\r\n            \"greedy\": false\r\n        }); // ~ mask \"9\" or mask \"99\" or ... mask \"9999999999\"\r\n        \r\n        // decimal format\r\n        $(\"#kt_inputmask_6\").inputmask('decimal', {\r\n            rightAlignNumerics: false\r\n        }); \r\n        \r\n        // currency format\r\n        $(\"#kt_inputmask_7\").inputmask('€ 999.999.999,99', {\r\n            numericInput: true\r\n        }); //123456  =>  € ___.__1.234,56\r\n\r\n        //ip address\r\n        $(\"#kt_inputmask_8\").inputmask({\r\n            \"mask\": \"999.999.999.999\"\r\n        });  \r\n\r\n        //email address\r\n        $(\"#kt_inputmask_9\").inputmask({\r\n            mask: \"*{1,20}[.*{1,20}][.*{1,20}][.*{1,20}]@*{1,20}[.*{2,6}][.*{1,2}]\",\r\n            greedy: false,\r\n            onBeforePaste: function (pastedValue, opts) {\r\n                pastedValue = pastedValue.toLowerCase();\r\n                return pastedValue.replace(\"mailto:\", \"\");\r\n            },\r\n            definitions: {\r\n                '*': {\r\n                    validator: \"[0-9A-Za-z!#$%&'*+/=?^_`{|}~\\-]\",\r\n                    cardinality: 1,\r\n                    casing: \"lower\"\r\n                }\r\n            }\r\n        });        \r\n    }\r\n\r\n    return {\r\n        // public functions\r\n        init: function() {\r\n            demos(); \r\n        }\r\n    };\r\n}();\r\n\r\njQuery(document).ready(function() {\r\n    KTInputmask.init();\r\n});"],"sourceRoot":""}